// src/components/HomePage.js
import React from 'react';
import logo from '../images/logo.png'; // Importa la imagen desde src
import '../App.css';

const HomePage = () => {
  return (
    <div>

    <div className="container-fluid p-0">
      {/* Imagen desde src */}
      <img src={logo} alt="logo"  style={{ width: '100%'}} />
    </div>

    <main className="main-content">
  <div className="container-md">
    <div className="row">
      <div className="col-md-5">
        <div className="card bg-welcome">
          <div className="card-body">
            <h2 className="card-title">Bienvenido</h2>
            <p className="card-text">Esta es la página principal de nuestra aplicación para gestionar traslados.</p>
          </div>
        </div>
      </div>
      <div className="col-md-5">
        <div className="card bg-login">
          <div className="card-body">
            <h2 className="card-title">Iniciar Sesión</h2>
            <form>
              {/* ... form content ... */}
            </form>
          </div>
        </div>
      </div>
    </div>
  </div>
</main>

    </div>
    
    
  );
};

export default HomePage;
